import string
abc = list(string.ascii_lowercase)

polymer = ""
# polymer = "dabAcCaCBAcCcaDA"

shortest_len = len(polymer)
removed = ''
shortest_polymer = polymer

for remove in abc:
    print(remove)
    rpolymer = polymer.replace(remove, '')
    rpolymer = rpolymer.replace(remove.upper(), '')
    if len(rpolymer) == len(polymer):
        print(remove + " not in polymer")
        continue

    some_thing_changed = True
    while some_thing_changed:
        some_thing_changed = False
        for i, c in enumerate(rpolymer):
            y = i + 1
            if y < len(rpolymer):
                b = rpolymer[y]
                #print(c, b)
                if c.lower() == b.lower() and not c == b:
                    #print(c, b)
                    rpolymer = rpolymer[:i] + rpolymer[y + 1:]
                    #print(polymer)
                    some_thing_changed = True
                    break

    if len(rpolymer) < shortest_len:
        shortest_len = len(rpolymer)
        removed = remove
        shortest_polymer = rpolymer
        print(removed, rpolymer)


print(removed, shortest_len, shortest_polymer)

